sys_variable_value.value:
(function execute(inputs, outputs) {
    var sat = new GlideRecord('x_1387186_sat_img_satellite_images');
    sat.addQuery('sys_id', inputs.satellite);
    sat.query();
    if (sat.next()) {
        var clearance = sat.getValue('clearance_level');
        outputs.clearance_level = clearance;
    }

    switch(clearance) {
        case 'Top Secret':
            outputs.role = 'x_1387186_soms.top_secret';
            break;
        case 'Secret':
            outputs.role = 'x_1387186_soms.secret';
            break;
        case 'Confidential':
            outputs.role = 'x_1387186_soms.confidential';
            break;
    }

})(inputs, outputs);

